// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awFileUploadLabelFunction } from 'js/AwFileUploadLabel';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwFileUploadLabel', () => import('js/AwFileUploadLabel'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awFileUploadLabelFunction",
            "deps": "js/AwFileUploadLabel"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "i18n": {
        "removeFileBtnTooltip": [
            "UIElementsMessages"
        ],
        "MB": [
            "UIElementsMessages"
        ]
    },
    "props": {
        "item": {
            "type": "object"
        },
        "remove-file-handler": {
            "type": "action"
        },
        "remove-tooltip": {
            "type": "string"
        }
    },
    "_viewModelId": "AwFileUploadLabel",
    "_uniqueViewModelId": "AwFileUploadLabel",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awFileUploadLabelFunction, undefined, ctxImportObj );

export default Component;
